INSERT INTO `ALERT_MATEDATA` VALUES ('A1','Number of billing cancels do not equal Prebill payment validations for the same time period','SELECT COUNT (1) FROM ((SELECT  T.REFERENCEOBJECTEXTID  FROM ECHO.D_SYMTASKS T WHERE T.EVENTNAME = \'PREBILL_PAYMENT_VALIDATION\'  AND TRUNC (T.CREATEDDATE_TM) BETWEEN from_date AND to_date  AND T.TASKSTATUS = \'N\' MINUS SELECT T.REFERENCEOBJECTEXTID  FROM ECHO.D_SYMTASKS T  WHERE T.EVENTNAME = \'BILLING_CANCEL\'  AND TRUNC (T.CREATEDDATE_TM) BETWEEN from_date AND to_date  AND T.TASKSTATUS = \'N\') UNION (SELECT T.REFERENCEOBJECTEXTID  FROM ECHO.D_SYMTASKS T  WHERE T.EVENTNAME = \'BILLING_CANCEL\'  AND TRUNC (T.CREATEDDATE_TM) BETWEEN from_date AND to_date  AND T.TASKSTATUS = \'N\' MINUS SELECT T.REFERENCEOBJECTEXTID  FROM ECHO.D_SYMTASKS T  WHERE T.EVENTNAME = \'PREBILL_PAYMENT_VALIDATION\'  AND TRUNC (T.CREATEDDATE_TM) BETWEEN from_date AND to_date  AND T.TASKSTATUS = \'N\'))',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A10','BSR Duplicates by EXTID','SELECT COUNT(1) FROM (select  count(1) from ECHO.D_SYMBSR A group by A.EXTID$ having count(1) > 1 )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A11','Entitlement Duplicates by EXTID','SELECT COUNT(1) FROM (select  count(1) from ECHO.D_SYMENTITLEMENT A group by A.EXTID$ having count(1) > 1 )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A13','Task Duplicates by EXTID','SELECT COUNT(1) FROM (select count(1) from ECHO.D_SYMTASKS A group by A.EXTID$ having count(1) > 1)',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A14','Account duplicates by GUID','SELECT COUNT(1) FROM (select count(1) from ECHO.D_SYMACCOUNT where guid not like \'%Delete%\' group by GUID having count(1) > 1 )',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A15','Account duplicates by EXTID','SELECT COUNT(1) FROM (select count(1) from ECHO.D_SYMACCOUNT A where guid not like \'%Delete%\' group by A.EXTID$ having count(1) > 1 )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A16','Wallet duplicates by EXTERNAL_REFERENCE_ID','SELECT COUNT(1) FROM ( SELECT count(1) FROM WALLET.SYMWALLET A  WHERE A.WALLET_ACTIVE_FLAG = \'Y\'  group by A.EXTERNAL_REFERENCE_ID, A.RIP_ID having count(1) > 1) ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A17','Wallets with invalid BIN','SELECT COUNT (DISTINCT a.psn) FROM ( SELECT ent.psn, cc.active_flag  FROM echo.d_symaccount acc,    echo.d_symentitlement ent,    wallet.symsourceoffunds sof,    wallet.symcreditcard cc WHERE acc.id$ = ent.account_id$  AND ent.arvalue IN (\'Y\', \'A\', \'P\')  AND ent.enddate_tm IS NOT NULL  AND acc.primarysourceoffundid = sof.source_of_fund_id  AND sof.payment_account_id = cc.payment_account_id  AND TRIM (TRANSLATE (cc.bin, \'0123456789\', \'   \')) IS NOT NULL  ) a where a.active_flag = \'Y\'',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A19','Missing Billing Profiles','SELECT COUNT (DISTINCT a.psn) FROM (  SELECT ent.psn, cc.active_flag  FROM echo.d_symaccount acc,    echo.d_symentitlement ent,    wallet.symsourceoffunds sof,    wallet.symcreditcard cc WHERE acc.id$ = ent.account_id$  AND ent.arvalue IN (\'Y\', \'A\', \'P\')  AND acc.primarysourceoffundid = sof.source_of_fund_id  AND sof.payment_account_id = cc.payment_account_id  AND cc.external_billing_id IS NULL  AND cc.cc_number IS NULL) a  where a.active_flag = \'Y\' ',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A1Test','Test Alert','Select 0 from dual',1440,1,0,2,3,999999,'N','lkrishnamurthi@symantec.com','ALERT'),('A20','CC is null for Valid Billing Profiles','SELECT COUNT (DISTINCT a.psn) FROM (  SELECT ent.psn, cc.active_flag  FROM echo.d_symaccount acc,    echo.d_symentitlement ent,    wallet.symsourceoffunds sof,    wallet.symcreditcard cc WHERE acc.id$ = ent.account_id$  AND ent.arvalue IN (\'Y\', \'A\', \'P\')  AND ent.enddate_tm IS NOT NULL  AND acc.primarysourceoffundid = sof.source_of_fund_id  AND sof.payment_account_id = cc.payment_account_id  AND cc.external_billing_id IS NOT NULL  AND cc.cc_number IS NULL) a  where a.active_flag = \'Y\'',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A21','Customers that need to be in T-45 plan but are mistakenly in T-30 plan','select count(1) from echo.d_symbsr bsr, WALLET.SYMSOURCEOFFUNDS sof, WALLET.SYMCREDITCARD crd, WALLET.SYMADDRESS addr where BSR.BILLINGPLANID = \'Annual-30\' and BSR.SOURCEOFFUNDID = SOF.SOURCE_OF_FUND_ID and SOF.PAYMENT_ACCOUNT_ID = CRD.PAYMENT_ACCOUNT_ID and CRD.ADDRESS_ID = ADDR.ADDRESS_ID and ADDR.COUNTRY_ID = 528 and UPPER(ADDR.STATE) in (\'FL\',\'IL\',\'NM\',\'UT\') and bsr.state1<>\'OPT_OUT\' ',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A22','Double Billing Orders ','SELECT COUNT(1) FROM (SELECT A.PRODUCT_SERIAL_NUMBER FROM APPS.SYMORDER A WHERE A.BUSINESS_SEGMENT=\'NORTON_AR\' AND A.OM_STATUS = \'CLOSED\' AND (A.OM_SUB_STATUS = \'EMPTY\') GROUP BY A.PRODUCT_SERIAL_NUMBER HAVING COUNT(1) > 1)',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABSMonitoring@symantec.com,DL-IT-eStore-ABS-DataForensicTeam@symantec.com','ALERT'),('A24','CancelAutoBill - Opted-Out in EBE but Still Opted-in into eABS','SELECT /*+ parallel(ACCOUNT,4) parallel(ent,4) parallel(wp,4) parallel(wbr_account,4) */    COUNT (1)  FROM echo.d_symaccount ACCOUNT,    echo.d_symentitlement ent,    ebe.wbr_product wp,    ebe.wbr_account WHERE wp.wbr_product_serial = ent.psn  AND ent.arvalue IN (\'Y\', \'A\', \'P\')  AND wp.wbr_product_auto_renew IN (\'B\', \'Q\')  AND ACCOUNT.id$ = ent.account_id$  AND TO_CHAR (wbr_account.wbr_account_guid) = ACCOUNT.guid  AND trunc(wp.wbr_product_moddate) < trunc(sysdate)+1',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A25','AddAutoBill - Opted-In into EBE but Opted-Out into eABS','SELECT /*+ parallel(pc,4) parallel(sc,4) parallel(wp,4) parallel(ent,4) parallel(wa,4) parallel(bp,4) parallel(pga,4)*/    COUNT (1)  FROM sas.popcon_current pc,    sas.subscription_current sc,    ebe.wbr_product wp,    echo.d_symentitlement ent,    ebe.wbr_account wa,    ebe.wbr_billing_profile bp,    (SELECT pga.product_serial, pga.account_id      FROM ebe.wbr_pga_prod_assoc pga     WHERE pga.ar_provider = \'T\' AND pga.is_active = \'T\') pga WHERE pc.popcon = sc.popcon  AND pc.vendor_id = sc.vendor_id  AND sc.popcon_block_id > 0  AND wp.wbr_product_serial = pc.product_serial  AND (sc.end_date IS NULL OR sc.end_date > SYSDATE)  AND ent.psn = wp.wbr_product_serial  AND (wp.wbr_product_abs <> \'S\' OR wp.wbr_product_abs IS NULL)  AND ent.arvalue IN (\'B\', \'Q\')  AND wp.wbr_product_auto_renew IN (\'Y\', \'A\', \'P\')  AND NVL (pga.account_id, wp.wbr_product_account_id) = wa.wbr_account_id  AND ent.psn = pga.product_serial(+)  AND wa.wbr_account_id = bp.wbr_bp_account_id(+)  AND bp.wbr_bp_superseded_by(+) IS NULL ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A26','AddAutoBill - Missing in eABS','SELECT /*+ parallel(p,4) */ count(1) FROM ebe.wbr_product p WHERE p.wbr_product_auto_renew IN (\'Y\', \'A\', \'P\') AND (p.wbr_product_abs != \'S\' or p.wbr_product_abs is null) AND NOT EXISTS (SELECT 1 FROM echo.d_symentitlement e WHERE p.wbr_product_serial = e.psn) AND p.wbr_product_moddate < sysdate - 1',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A27','DisableSourceofFund - Payment Account active in Wallet but disabled in EBE','SELECT /*+ parallel(wal,4) parallel(sof,4) parallel(crd,4) parallel(bill,4) parallel(acc,4) parallel(ent,4) */    COUNT (1)  FROM wallet.symwallet wal,    wallet.symsourceoffunds sof,    wallet.symcreditcard crd,    ebe.wbr_billing_profile bill,    echo.d_symaccount acc,    echo.d_symentitlement ent WHERE wal.wallet_id = sof.wallet_id  AND sof.payment_account_id = crd.payment_account_id  AND crd.active_flag = \'Y\'  AND crd.cc_number IS NOT NULL  AND crd.external_billing_id = TO_CHAR (bill.wbr_bp_id)  AND acc.guid = wal.external_reference_id  AND acc.id$ = ent.account_id$  AND ent.arvalue IN (\'Y\', \'A\', \'P\')  AND NOT EXISTS (      SELECT /*+ parallel(bills,4) */         1       FROM ebe.wbr_billing_profile bills      WHERE bills.wbr_bp_account_id = bill.wbr_bp_account_id       AND bills.wbr_bp_superseded_by IS NULL)',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A28','UpdateSourceofFund - Payment Account Outdated in eABS','SELECT /*+ parallel(wal,4) parallel(sof,4) parallel(sc,4) parallel(wa,4) parallel(wb,4) */  COUNT (DISTINCT wa.wbr_account_guid ) FROM wallet.symwallet wal,  wallet.symsourceoffunds sof,  wallet.symcreditcard sc,  ebe.wbr_account wa,  ebe.wbr_billing_profile wb WHERE wal.wallet_id = sof.wallet_id AND sof.payment_account_id = sc.payment_account_id AND sc.active_flag = \'Y\' AND   wb.wbr_bp_payment_type <> 4560120 AND wal.external_reference_id = wa.wbr_account_guid||\'\' AND wa.wbr_account_id = wb.wbr_bp_account_id AND wb.wbr_bp_superseded_by IS NULL  AND (sc.external_billing_id <> TO_CHAR(wb.wbr_bp_id)   OR wb.wbr_bp_account_last4 <> sc.last_four  OR EXTRACT (YEAR FROM TO_DATE (wb.wbr_bp_account_expdate, \'YYYYMM\')) <> sc.exp_year   OR EXTRACT (MONTH FROM TO_DATE (wb.wbr_bp_account_expdate, \'YYYYMM\')) <> sc.exp_month   ) AND EXISTS ( SELECT 1 FROM echo.d_symaccount sa, echo.d_symentitlement ent , echo.d_symbsr bsr   WHERE ent.bsr_id$ = bsr.id$   AND bsr.account_id$ = sa.id$   AND sa.guid = wal.external_reference_id   AND ent.arvalue IN (\'Y\', \'A\', \'P\') )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A29','Expunged PSNs- Deleted in EBE but opted-in into ABS','SELECT /*+ parallel(ent,4) parallel(ACCOUNT,4) */    COUNT (1)  FROM echo.d_symentitlement ent, echo.d_symaccount ACCOUNT WHERE ent.arvalue IN (\'Y\', \'A\', \'P\')  AND ACCOUNT.id$ = ent.account_id$  AND NOT EXISTS (SELECT /*+ parallel(wp,4) */              1           FROM ebe.wbr_product wp           WHERE wp.wbr_product_serial = ent.psn)  AND (  TRUNC (ent.createddate_tm) < TRUNC (SYSDATE)     OR TRUNC (ent.lastupdateddate_tm) < TRUNC (SYSDATE)    )  AND LOWER (ACCOUNT.emailaddress) NOT LIKE \'%symantec.com\'',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A3','Records in PREBILL_PAYMENT_VALIDATION state stuck in \'P\' longer than 30 minutes. ','SELECT COUNT(1) FROM ( SELECT T.LASTUPDATEDDATE_TM, SYSDATE-200 ,SYSDATE, ROUND(((EXTRACT(DAY FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM)*24*60*60)+ (EXTRACT(HOUR FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM)*60*60)+ (EXTRACT(MINUTE FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM)*60)+ EXTRACT(SECOND FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM))/60,0) MINS, T.EVENTNAME FROM ECHO.D_SYMTASKS T WHERE T.TASKSTATUS=\'P\' AND T.EVENTNAME =\'PREBILL_PAYMENT_VALIDATION\' AND T.LASTUPDATEDDATE_TM BETWEEN From_Date AND To_Date)',60,1,1,10,11,999999,'Y','DL-IT-eStore-ABSMonitoring@symantec.com','ALERT'),('A30','Enddate Mismatch- Enddate null or past in eABS for oPTiN PSN in EBE enddate in future','SELECT /*+ parallel(wa,4) parallel(wp,4) parallel(pc,4) parallel(sc,4) parallel(ent,4) parallel(pga,4) */ COUNT (DISTINCT psn) psn_count FROM ebe.wbr_account wa, ebe.wbr_product wp, sas.popcon_current pc, sas.subscription_current sc, echo.d_symentitlement ent, (SELECT /*+ parallel(wbr_pga_prod_assoc,4) */  account_id, product_serial, account_guid FROM ebe.wbr_pga_prod_assoc WHERE ar_provider = \'T\' AND is_active = \'T\') pga WHERE wp.wbr_product_serial = ent.psn AND wp.wbr_product_serial = pc.product_serial(+) AND pc.popcon = sc.popcon(+) AND pc.vendor_id = sc.vendor_id(+) AND sc.popcon_block_id(+) > 0 AND wp.wbr_product_auto_renew IN (\'Y\', \'A\', \'P\') AND ent.arvalue in (\'Y\',\'A\',\'P\')   AND ( (   ent.enddate_tm IS NULL AND TRUNC (sc.end_date) > TRUNC (SYSDATE) ) OR (   ent.enddate_tm IS NOT NULL AND TRUNC (sc.end_date) <> TRUNC(ent.enddate_tm) AND TRUNC (sc.end_date) > TRUNC (SYSDATE) ) ) AND pga.product_serial(+) = wp.wbr_product_serial AND NVL (pga.account_id, wp.wbr_product_account_id) = wa.wbr_account_id ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A30Test','Test Alert','Select 100 from dual',1440,1,1,2,11,999999,'N','hanimi_meruva@symantec.com,veeraju_pusumanchi@symantec.com','ALERT'),('A31','GUID Mismatch- between eABS and EBE for the Active PSN in EBE & sas enddate > sysdate','SELECT    COUNT(DISTINCT ent.psn) PSN_COUNT FROM  sas.popcon_current pc,     sas.subscription_current sc,     ebe.wbr_product wp,     ebe.wbr_account wa,     (SELECT /*+ parallel(wbr_pga_prod_assoc,6) */ account_id, product_serial, account_guid FROM ebe.wbr_pga_prod_assoc     WHERE ar_provider = \'T\' AND is_active = \'T\') pga,     ebe.wbr_billing_profile bp,     echo.d_symentitlement ent,     echo.d_symaccount acc WHERE  pc.popcon = sc.popcon(+)  AND  pc.vendor_id = sc.vendor_id(+)  AND  sc.popcon_block_id(+) > 0 AND  wp.wbr_product_serial = pc.product_serial(+)  AND  pga.product_serial(+) = wp.wbr_product_serial AND   NVL(pga.account_id, wp.wbr_product_account_id) = wa.wbr_account_id AND  wa.wbr_account_id = bp.wbr_bp_account_id(+) AND  bp.wbr_bp_superseded_by(+) IS NULL AND  wp.wbr_product_serial(+) = ent.PSN AND   ent.account_id$ = acc.id$ AND   TRUNC(sc.end_date) > TRUNC(SYSDATE) AND   wp.wbr_product_auto_renew IN (\'Y\', \'A\', \'P\') AND   to_char(wa.wbr_account_guid) <> TO_CHAR(acc.guid) ',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A31Test','Test Alert','Select 100 from dual',1440,1,1,2,11,999999,'N','hanimi_meruva@symantec.com;veeraju_pusumanchi@symantec.com','ALERT'),('A32','Multiple Active Payment Account Id','SELECT /*+ parallel( outer_table,4) parallel( main_query,4) parallel( s,4) parallel( w,4)*/    COUNT (1)  FROM wallet.symcreditcard outer_table,    (SELECT  /*+ parallel(d,4) */         source_of_fund_id, MAX (created_date) created_date       FROM wallet.symcreditcard d      WHERE d.active_flag = \'Y\'     GROUP BY d.source_of_fund_id      HAVING COUNT (1) > 1) main_query,    wallet.symsourceoffunds s,    wallet.symwallet w WHERE outer_table.source_of_fund_id = main_query.source_of_fund_id  AND s.source_of_fund_id = outer_table.source_of_fund_id  AND s.wallet_id = w.wallet_id  AND w.rip_id = \'NORTON_AR\'  AND outer_table.active_flag = \'Y\'',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A33','Wrong Billing Plan - plan45to30','SELECT /*+ parallel(bsr,4) parallel(sof,4) parallel(crd,4) parallel(addr,4) */    COUNT (1)  FROM echo.d_symbsr bsr,    wallet.symsourceoffunds sof,    wallet.symcreditcard crd,    wallet.symaddress addr WHERE bsr.billingplanid = \'Annual-45\'  AND bsr.sourceoffundid = sof.source_of_fund_id  AND sof.payment_account_id = crd.payment_account_id  AND crd.address_id = addr.address_id  AND NOT EXISTS (      SELECT 1       FROM DUAL      WHERE addr.country_id = 528       AND UPPER (addr.state) IN (\'FL\', \'IL\', \'NM\', \'UT\', \'LA\'))  AND bsr.state1 <> \'OPT_OUT\'',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A34','Wrong Billing Plan - plan30to45','SELECT /*+ parallel(bsr,4) parallel(sof,4) parallel(crd,4) parallel(addr,4) */    COUNT (1)  FROM echo.d_symbsr bsr,    wallet.symsourceoffunds sof,    wallet.symcreditcard crd,    wallet.symaddress addr WHERE bsr.billingplanid = \'Annual-30\'  AND bsr.sourceoffundid = sof.source_of_fund_id  AND sof.payment_account_id = crd.payment_account_id  AND crd.address_id = addr.address_id  AND addr.country_id = 528  AND UPPER (addr.state) IN (\'FL\', \'IL\', \'NM\', \'UT\', \'LA\')  AND bsr.state1 <> \'OPT_OUT\'  AND CRD.ACTIVE_FLAG = \'Y\' ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A35','First name and Last Name are null for valid Account in eABS','SELECT /* parallel( acc,4) */ COUNT (1)  FROM echo.d_symaccount acc WHERE (acc.firstname IS NULL OR acc.lastname IS NULL)  AND acc.emailaddress NOT LIKE \'PURGED_%\'           ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A36','Language code mapping issue','SELECT  COUNT(1) FROM ebe.wbr_account wa, ebe.wbr_product wp, ebe.wbr_contact wc, echo.d_symaccount sa, echo.d_symentitlement ent WHERE wp.wbr_product_serial = ent.psn AND sa.guid = TO_CHAR (wa.wbr_account_guid) AND wa.wbr_account_user_id = wc.wbr_contact_email AND wa.wbr_account_id = wc.wbr_contact_account_id AND sa.id$ = ent.account_id$ AND UPPER (wa.wbr_account_language) <> UPPER (sa.languagecode) AND UPPER (wa.wbr_account_user_id) <> UPPER (sa.emailaddress)',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A37','Duplicate GUID account','SELECT   COUNT(1) FROM echo.d_symaccount sa WHERE sa.guid NOT LIKE \'%Delete%\' GROUP BY sa.guid HAVING COUNT (1) > 1',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A38','BillingCancel but PSN still opt-in in Eabs','SELECT  COUNT(1) from echo.d_symbsr b, echo.d_symentitlement e where optoutby = \'BillingCancel\' and b.entitlement_id$ = e.id$ and E.ARVALUE in (\'Y\', \'A\', \'P\') and e.bsr_id$ is null',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A39','BillingCancel but PSN still opted-in in EBE','SELECT /*+ parallel(b,4) parallel(p,4) parallel(e,4) parallel(pc,4) parallel(sc,4) */    COUNT (1)  FROM echo.d_symbsr b,    ebe.wbr_product p,    echo.d_symentitlement e,    sas.popcon_current pc,    sas.subscription_current sc WHERE optoutby = \'BillingCancel\'  AND e.psn = p.wbr_product_serial  AND b.entitlement_id$ = e.id$  AND e.bsr_id$ IS NULL  AND e.arvalue IN (\'B\', \'Q\')  AND p.wbr_product_auto_renew IN (\'Y\', \'A\', \'P\')  AND pc.popcon = sc.popcon  AND pc.vendor_id = sc.vendor_id  AND sc.popcon_block_id > 0  AND p.wbr_product_serial = pc.product_serial  AND sc.end_date < SYSDATE',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A4','Records in PREBILL_START state stuck in \'P\' longer than 30 minutes. ','SELECT COUNT(1) FROM ( SELECT T.LASTUPDATEDDATE_TM, SYSDATE-200 ,SYSDATE, ROUND(((EXTRACT(DAY FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM)*24*60*60)+ (EXTRACT(HOUR FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM)*60*60)+ (EXTRACT(MINUTE FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM)*60)+ EXTRACT(SECOND FROM T.LASTUPDATEDDATE_TM - T.DUEDATETIME_TM))/60,0) MINS, T.EVENTNAME FROM ECHO.D_SYMTASKS T WHERE T.TASKSTATUS=\'P\' AND T.EVENTNAME =\'PREBILL_START\' AND T.LASTUPDATEDDATE_TM BETWEEN From_Date AND To_Date )',60,1,1,10,11,999999,'Y','DL-IT-eStore-ABSMonitoring@symantec.com','ALERT'),('A40','Double Billing Annual Orders ','SELECT COUNT(1) FROM  (SELECT F.PRODUCT_SERIAL_NUMBER FROM APPS.TORDER A,  APPS.SYMORDER B,  APPS.TORDERSHIPMENT C,  APPS.TORDERSKU D,  APPS.SYMORDERSKU E,  apps.symfulfillmententitlement F WHERE A.UIDPK      = B.ORDER_UID AND B.BUSINESS_SEGMENT =\'NORTON_AR\' AND B.OM_STATUS     = \'CLOSED\' AND B.ORDER_UID     = C.ORDER_UID AND C.UIDPK       = D.order_shipment_uid AND D.UIDPK       = E.order_sku_uid AND E.offer_id_type_uid = 1000000000000005019 AND (B.OM_SUB_STATUS  = \'EMPTY\') AND F.order_sku_uid = E.order_sku_uid AND A.CREATED_DATE   > SYSDATE - 90 AND F.PRODUCT_SERIAL_NUMBER not in ( \'XCCGT8264M9H\',\'GWG92JV4GWCR\') GROUP BY F.PRODUCT_SERIAL_NUMBER HAVING COUNT(1) > 1) ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABSMonitoring@symantec.com,DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A42','SKUM mismatch between SAS/EBE and eABS','SELECT /*+ parallel(s,3) parallel(p,3) */    COUNT(DISTINCT s.psn) FROM nsas.popcon_current p, echo.d_symentitlement s WHERE s.psn = p.product_serial AND s.arvalue IN (\'Y\', \'A\', \'P\') AND s.skum <> p.vskum AND P.MODIFY_DATE < sysdate-1 ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABSMonitoring@symantec.com,DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A43','BSRTransaction duplicates by EXTID','SELECT COUNT(1) FROM (select count(1) from ECHO.D_SYMBSRTRANSACTION A group by A.EXTID$ having count(1) > 1 )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABSMonitoring@symantec.com,DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A44',' Missing BP in eABS exists in EBE for Opt-In PSN','SELECT /*+ parallel(wp,4) parallel(wa,4) parallel(bp,4) */     COUNT(1) FROM ebe.wbr_product wp,     ebe.wbr_account wa,     ebe.wbr_billing_profile bp,     echo.d_symentitlement ent,     echo.d_symaccount acc,     echo.d_symbsr bsr WHERE wp.wbr_product_serial = ent.psn AND   ent.bsr_id$ = bsr.id$ AND   bsr.account_id$ = acc.id$ AND   acc.guid = wa.wbr_account_guid||\'\' AND wa.wbr_account_id = bp.wbr_bp_account_id AND bp.wbr_bp_superseded_by IS NULL AND wp.wbr_product_serial IN( SELECT /*+ parallel(b,4) parallel(e,4) */  distinct psn FROM echo.d_symbsr b, echo.d_symentitlement e WHERE e.bsr_id$ = b.id$ AND e.arvalue IN (\'Y\', \'A\', \'P\') MINUS ( SELECT /*+ parallel(b,4) parallel(e,4) parallel(cc,4) parallel(sof,4) */  distinct psn FROM echo.d_symbsr b,  echo.d_symentitlement e,  wallet.symcreditcard cc,  wallet.symsourceoffunds sof WHERE e.bsr_id$ = b.id$ AND e.arvalue IN (\'Y\', \'A\', \'P\') AND sof.payment_account_id = cc.payment_account_id AND sof.source_of_fund_id = b.sourceoffundid AND cc.active_flag = \'Y\' AND cc.external_billing_id IS NOT NULL AND TRIM (TRANSLATE (cc.bin, \'0123456789\', \' \')) IS NULL  UNION SELECT /*+ parallel(b,4) parallel(e,4) parallel(dd,4) parallel(sof,4) */  distinct psn  FROM echo.d_symbsr b,     echo.d_symentitlement e,     wallet.symdirectdebit dd,     wallet.symsourceoffunds sof WHERE e.bsr_id$ = b.id$ AND e.arvalue IN (\'Y\', \'A\', \'P\') AND sof.payment_account_id = dd.payment_account_id AND sof.source_of_fund_id = b.sourceoffundid AND dd.external_billing_id IS NOT NULL AND dd.active_flag = \'Y\' ) ) and bsr.nextbillingdate_tm > sysdate+1',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A45','Invalid Payment-Country-Currency combination','select count(1) from (   select /*+ Parallel ( act 4 ) Parallel ( ent 4 ) Parallel ( cc 4 ) Parallel ( sof 4 ) Parallel ( adr 4 ) Parallel ( cty 4 ) Parallel ( bsr 4 ) */   distinct(ent.psn)   from   ECHO.D_SYMACCOUNT act,   ECHO.D_SYMENTITLEMENT ent,   WALLET.SYMCREDITCARD cc,   WALLET.SYMSOURCEOFFUNDS sof,   WALLET.SYMADDRESS adr,   WALLET.SYMCOUNTRY cty,   ECHO.D_SYMBSR bsr   where   ENT.ACCOUNT_ID$ = ACT.ID$   and ACT.PRIMARYSOURCEOFFUNDID = SOF.SOURCE_OF_FUND_ID   and SOF.PAYMENT_ACCOUNT_ID = CC.PAYMENT_ACCOUNT_ID   and CC.ACTIVE_FLAG = \'Y\'   and CC.PAYMENT_SUBTYPE_ID not in (\'PS101\',\'PS102\')   and CC.ADDRESS_ID = ADR.ADDRESS_ID   and ADR.COUNTRY_ID = CTY.COUNTRY_ID   and CTY.COUNTRY_ID in (\'437\',\'307\',\'471\',\'344\',\'340\')   and ENT.BSR_ID$ = BSR.ID$   and BSR.CURRENCY in (\'MXN\',\'ARS\',\'PLN\',\'COP\',\'CLP\') ) ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABSMonitoring@symantec.com,DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A46','BSR BILLINGPLANID with No-Plan','SELECT COUNT(1) FROM ECHO.D_SYMBSR BSR, ECHO.D_SYMENTITLEMENT ENT WHERE BSR.BILLINGPLANID = \'No-Plan\' AND ENT.BSR_ID$ = BSR.ID$',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABSMonitoring@symantec.com,DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A48','Identify SBT products that are enrolled in AR in eABS','select /*+ parallel(ent,6) parallel(wp,6) */    count(ent.psn) from echo.d_symentitlement ent,    ebe.wbr_product wp where wp.wbr_product_serial = ent.psn and  ent.arvalue in (\'Y\', \'A\', \'P\') and  wp.wbr_product_abs = \'S\'',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A49','Wallets with multiple active SOF (Part 3-3) - CREDIT','select /*+ parallel(wal,4) parallel(sof,4) parallel(sc,4) parallel(ent,4) parallel(acc,4) */ count(distinct ent.psn) from wallet.symwallet wal,   wallet.symsourceoffunds sof,   wallet.symcreditcard sc,   echo.d_symbsr bsr,   echo.d_symentitlement ent,   echo.d_symaccount acc where wal.wallet_id=sof.wallet_id and  sof.payment_account_id=sc.payment_account_id and  sc.active_flag=\'Y\' and  wal.external_reference_id = acc.guid and  ent.bsr_id$ = bsr.id$ and  bsr.ACCOUNT_ID$ = acc.id$ and  ent.arvalue in (\'Y\',\'A\',\'P\') and  acc.guid IN ( select DISTINCT sw.external_reference_id from WALLET.symsourceoffunds sf,  WALLET.symcreditcard scc,  wallet.symwallet sw  where sw.wallet_id = sf.wallet_id  and sf.source_of_fund_id = scc.source_of_fund_id  and scc.active_flag = \'Y\'  and sf.wallet_id in (SELECT sw.wallet_id   FROM wallet.symwallet sw,    echo.d_symaccount sa   WHERE sw.external_reference_id = sa.guid   AND sw.RIP_ID = \'NORTON_AR\'   AND (sa.primarysourceoffundid IS NULL   OR sa.primarysourceoffundid = \'\')    )  )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A51','Wallets with multiple active SOF (Part 1-3) ','select /*+ parallel(wal,4) parallel(sof,4) parallel(sc,4) parallel(ent,4) parallel(acc,4) */ count(distinct ent.psn) from wallet.symwallet wal,   wallet.symsourceoffunds sof,   wallet.symcreditcard sc,   echo.d_symbsr bsr,   echo.d_symentitlement ent,   echo.d_symaccount acc where wal.wallet_id=sof.wallet_id and  sof.payment_account_id=sc.payment_account_id and  sc.active_flag=\'Y\' and  wal.external_reference_id = acc.guid and  ent.bsr_id$ = bsr.id$ and  bsr.ACCOUNT_ID$ = acc.id$ and  ent.arvalue in (\'Y\',\'A\',\'P\') and  wal.wallet_id in ( SELECT /*+ all_rows parallel ( SOF 4) parallel ( SW 4) parallel */ SW.WALLET_ID FROM WALLET.SYMSOURCEOFFUNDS SOF, WALLET.SYMWALLET SW  WHERE SW.WALLET_ID = SOF.WALLET_ID  and SW.RIP_ID = \'NORTON_AR\' group by sw.wallet_id having count(1) > 1 )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A52','UpdateSourceofFund - Payment Account Outdated in eABS - directdebit',' SELECT /*+ parallel(wal,4) parallel(sof,4) parallel(sc,4) parallel(wa,4) parallel(wb,4) */  COUNT (DISTINCT wa.wbr_account_guid ) FROM wallet.symwallet wal,  wallet.symsourceoffunds sof,  wallet.symdirectdebit sc,  ebe.wbr_account wa,  ebe.wbr_billing_profile wb WHERE wal.wallet_id = sof.wallet_id AND sof.payment_account_id = sc.payment_account_id AND sc.active_flag = \'Y\' AND   wb.wbr_bp_payment_type = 4560120 AND wal.external_reference_id = wa.wbr_account_guid||\'\' AND wa.wbr_account_id = wb.wbr_bp_account_id AND wb.wbr_bp_superseded_by IS NULL  AND sc.external_billing_id <> TO_CHAR(wb.wbr_bp_id) AND EXISTS ( SELECT 1 FROM echo.d_symaccount sa, echo.d_symentitlement ent , echo.d_symbsr bsr   WHERE ent.bsr_id$ = bsr.id$  AND bsr.account_id$ = sa.id$   AND sa.guid = wal.external_reference_id   AND ent.arvalue IN (\'Y\', \'A\', \'P\') ) AND   trunc(wb.wbr_bp_moddate) < trunc(sysdate)-2',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A53','Duplicate PSN in entitlement table','select count(1) from ( select psn, COUNT(1) from echo.d_symentitlement where psn is not null group by psn having count(1) >1 )',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A54','SKUP mismatch between SAS/EBE and eABS','SELECT /*+ parallel(s,3) parallel(p,3) */     COUNT(DISTINCT s.psn) FROM  nsas.popcon_current p,   echo.d_symentitlement s WHERE   s.psn = p.product_serial AND s.arvalue IN (\'Y\', \'A\', \'P\') AND s.skup <> p.vskup and p.MODIFY_DATE < sysdate-1',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A55','PSN null in entitlement table','select count(1) from echo.d_symentitlement where psn is null',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A56','Purge account in OLP and not Purge in eABS ','SELECT COUNT(WBR_ACCOUNT_GUID) FROM ebe.wbr_account wa ,  ebe.wbr_contact wc,  echo.d_symaccount sa WHERE wa.wbr_account_id = wc.wbr_contact_account_id(+) AND  sa.guid = wa.wbr_account_guid||\'\' AND   wa.wbr_account_user_id like \'PURGED%\' AND sa.emailaddress not like \'PURGED%\' AND  sa.emailaddress not like \'expunge@symantec.com\' ',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A57','BSR_ID$ not null in entitlement table for the Opt-Out PSN','SELECT COUNT(1) FROM ECHO.D_SYMENTITLEMENT A WHERE A.ARVALUE IN (\'B\',\'Q\',\'N\') AND A.BSR_ID$ IS NOT NULL AND PARENTID_ID$ IS NULL',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A7','Initializations with wrong BSR state in eABS','SELECT COUNT (1) FROM ECHO.D_SYMTASKS T WHERE TRUNC (T.DUEDATETIME_TM) BETWEEN from_date AND to_date AND T.EVENTNAME = \'PREBILL_INITIATE\'  AND T.TASKSTATUS = \'N\'  AND T.REFERENCEOBJECTEXTID IN (SELECT /*+ PARALLEL(B,6) */B.EXTID$ FROM ECHO.D_SYMBSR B WHERE B.STATE1 <> \'DORMANT\')',1440,1,1,10,11,999999,'N','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT'),('A8','Tasks with null due date','SELECT COUNT(1) FROM ECHO.D_SYMTASKS T WHERE T.DUEDATETIME_TM IS NULL AND T.TASKSTATUS = \'N\'',1440,1,1,10,11,999999,'Y','DL-IT-eStore-ABS-DataForensicTeam@symantec.com,Tatabbai_Bolli@symantec.com,Joseph_Liyana@symantec.com,Lionel_Iorgulescu@symantec.com','ALERT');
